import axios from 'axios';
import config from '../config/config';

function getObservationsBySeriesId(seriesId, startTime, endTime){
	startTime = startTime || '1999-08-14';
	endTime = endTime || '2019-08-13';
	const url = `/fred/series/observations?file_type=json&api_key=${config.API_KEY}&series_id=${seriesId}&observation_start=${startTime}&observation_end=${endTime}&frequency=a&aggregation_method=avg`;
  	return axios.get(url).then(response => response.data);
}

export { getObservationsBySeriesId }
